import React from 'react';

const ComingSoon = () => {
return (
	<div
	style={{
		display: 'flex',
		justifyContent: 'Right',
		alignItems: 'Right',
		height: '100vh'
	}}
	>
	<h1>Moving that are coming soon.</h1>
	</div>
);
};

export default ComingSoon;
